import React from 'react';
import './Song.css';
import ListGroup from 'react-bootstrap/ListGroup';
import axios from 'axios';
import { API_BASE_URL, ACCESS_TOKEN_NAME, CURRENT_SONG } from '../../constants/apiConstants';
import Button from 'react-bootstrap/Button';

class Song extends React.Component {
    constructor(props) {
        super(props);
        this.deleteSong = this.deleteSong.bind(this);
        this.handleOnClick = this.handleOnClick.bind(this);
    }

    deleteSong() {
        Promise.resolve(this.deleteSongPost(this.props.playlistName, this.props.songName, this.props.songID)).then((result) => this.props.parentCallback(result));
    }

    async deleteSongPost(playlistName, songName, songID) {
        return axios.post(API_BASE_URL + '/media/deleteSong', { playlistName: playlistName, songName: songName, songID: songID}, { headers: { "auth-token": localStorage.getItem(ACCESS_TOKEN_NAME) } })
            .then(function (response) {
                if (response.status === 200) {
                    return response.data.affected;
                }
            }
            )
            .catch(function (error) {
                console.log(error);
            })
    }

    handleOnClick(event) {
        this.props.updateCurrentSong(this.props.songID)
    }

    render() {
        return (
            <ListGroup.Item id="song-frame">
                              <div className="nav-item dropdown">
                            <a className="nav-link dropdown-toggle"
                                href="#"
                                id="navbarDropdownMenuLink"
                                data-toggle="dropdown"
                                aria-haspopup="true"
                                aria-expanded="false">
                                <svg xmlns="http://www.w3.org/2000/svg"
                                    width="36" height="36"
                                    fill="currentColor"
                                    className="bi bi-file-person-fill"
                                    viewBox="0 0 16 16">
                                    <path d="M12 0H4a2 2 0 0 0-2 2v12a2 2 0 0 0 2 2h8a2 2 0 0 0 2-2V2a2 2 0 0 0-2-2zm-1 7a3 3 0 1 1-6 0 3 3 0 0 1 6 0zm-3 4c2.623 0 4.146.826 5 1.755V14a1 1 0 0 1-1 1H4a1 1 0 0 1-1-1v-1.245C3.854 11.825 5.377 11 8 11z" />
                                </svg>
                            </a>
                            <div className="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">
                                <a className="dropdown-item" onClick={this.onSelection}>{localStorage.getItem(ACCESS_TOKEN_NAME) ? 'Logout' : 'Login'}</a>
                                <a className="dropdown-item" href="#">Delete Account</a>
                            </div>
                        </div>
                <Button id="song-item" onClick={this.handleOnClick}>{this.props.songName}</Button>
                <svg
                    id="delete-song"
                    xmlns="http://www.w3.org/2000/svg"
                    width="26"
                    height="26"
                    fill="currentColor"
                    className="bi bi-plus b-plain"
                    viewBox="0 0 16 16"
                    onClick={this.deleteSong}
                >
                    <path d="M8 15A7 7 0 1 1 8 1a7 7 0 0 1 0 14zm0 1A8 8 0 1 0 8 0a8 8 0 0 0 0 16z"/>
                    <path d="M4.646 4.646a.5.5 0 0 1 .708 0L8 7.293l2.646-2.647a.5.5 0 0 1 .708.708L8.707 8l2.647 2.646a.5.5 0 0 1-.708.708L8 8.707l-2.646 2.647a.5.5 0 0 1-.708-.708L7.293 8 4.646 5.354a.5.5 0 0 1 0-.708z"/>
                </svg>
            </ListGroup.Item>
        );
    }
}

export default Song;
